"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[8264],{3859:e=>{e.exports=JSON.parse('{"label":"Data Science","permalink":"/portfolio/docs/tags/data-science","allTagsPath":"/portfolio/docs/tags","count":20,"items":[{"id":"stats/ab-test","title":"A/B Test","description":"The basics: What you need to know","permalink":"/portfolio/docs/stats/ab-test"},{"id":"misc/auto-commit","title":"Automatic Git Commit","description":"Are you tired of manually committing to your GitHub repository every day? Do you wish there was an easier way to stay on top of your daily commits? Look no further than Python and GitHub Actions!","permalink":"/portfolio/docs/misc/auto-commit"},{"id":"eda/data-balancing","title":"Data Balancing","description":"Welcome back to another thrilling ride on the data science rollercoaster. Today, we\u2019re diving headfirst into the wacky world of data balancing&mdash;a crucial skill in your machine learning toolkit. Picture this: you\u2019ve got a dataset that\u2019s as unbalanced as a seesaw with an elephant on one side and a feather on the other. Fear not! We\u2019re about to wield our coding wands and conjure up some enchanting solutions to slay the data imbalance dragon. \ud83d\udc09\ud83d\udd25","permalink":"/portfolio/docs/eda/data-balancing"},{"id":"eda/missing-data","title":"Dealing with Missing Data","description":"Welcome, fellow data enthusiasts and Python aficionados! Today, we embark on a thrilling journey to tackle one of the most common challenges in data science &mdash; missing data! Ah, those pesky gaps in our datasets that can ruin our models and give us headaches. But fear not! With Python as our trusty companion, we shall equip ourselves with the skills to handle missing data. So, fasten your seatbelts and let\u2019s dive in!","permalink":"/portfolio/docs/eda/missing-data"},{"id":"eda/dirty-data","title":"Dirty Data","description":"The Intriguing World of Dirty Data","permalink":"/portfolio/docs/eda/dirty-data"},{"id":"misc/xai","title":"Explainable AI","description":"What is Explainable AI?","permalink":"/portfolio/docs/misc/xai"},{"id":"time-series/sktime","title":"Forecasting with sktime","description":"Greetings, data enthusiasts! Today, we embark on a thrilling journey into the realm of time-series forecasting using the marvelous sktime library. Whether you\u2019re a seasoned data scientist seeking to sharpen your skills or a curious beginner taking your first steps into the world of time-series analysis, this tutorial promises to unravel the magic behind forecasting with practicality. So, fasten your seatbelts and let\u2019s dive in!","permalink":"/portfolio/docs/time-series/sktime"},{"id":"misc/guideline-ml","title":"Guideline for ML","description":"Understanding Model Training","permalink":"/portfolio/docs/misc/guideline-ml"},{"id":"computer-vision/ants-bees-classification","title":"Image Classification App","description":"tl;dr","permalink":"/portfolio/docs/computer-vision/ants-bees-classification"},{"id":"synthetic-data/intro","title":"Introduction","description":"Introduction","permalink":"/portfolio/docs/synthetic-data/intro"},{"id":"misc/thresh-log-regr","title":"Logistic Regression Thresholds","description":"Hey there, data enthusiasts, Pythonistas, and machine learning mavens! Today, we\u2019re diving deep into the intriguing realm of logistic regression thresholds! Buckle up, as we embark on a fun-filled journey to find that elusive sweet spot where true magic happens! \ud83e\uddd9\u200d\u2642\ufe0f","permalink":"/portfolio/docs/misc/thresh-log-regr"},{"id":"stats/pvalue~0.05","title":"p-Value ~ 0.05","description":"Understanding p-value & the Significance Level","permalink":"/portfolio/docs/stats/pvalue~0.05"},{"id":"data-format/parquet","title":"Parquet format","description":"Introduction","permalink":"/portfolio/docs/data-format/parquet"},{"id":"data-visualization/pitfalls","title":"Pitfalls in Data Visualization","description":"Hello data enthusiasts!","permalink":"/portfolio/docs/data-visualization/pitfalls"},{"id":"eda/polars","title":"Polars","description":"Introduction","permalink":"/portfolio/docs/eda/polars"},{"id":"misc/qrcode","title":"QR Code","description":"Welcome to the world of QR code generation! As a data scientist, I understand the importance of effective data representation, and QR codes are a fantastic tool for this purpose. In this tutorial, we\u2019ll embark on a journey to demystify QR code generation using python-qrcode, ensuring that you gain practical skills to implement QR code generation effortlessly. So, grab your coding gear and let\u2019s get started!","permalink":"/portfolio/docs/misc/qrcode"},{"id":"misc/reproducibility","title":"Reproducibility","description":"Welcome to another exciting journey into the world of data science. In this article, we will comprehensively explore the critical concept of reproducibility in data science projects. Reproducibility ensures that your data analysis and machine learning experiments can be duplicated by others, leading to more reliable and trustworthy results. Join me as we delve into the world of reproducibility and learn how to implement it effectively in your projects.","permalink":"/portfolio/docs/misc/reproducibility"},{"id":"scrape/jobinventory.com","title":"Scraping Job Listings","description":"Are you tired of manually scrolling through endless job postings to find the perfect opportunity? Look no further! In this tutorial, I\u2019ll walk you through the steps of scraping job listings from JobInventory.com using Python.","permalink":"/portfolio/docs/scrape/jobinventory.com"},{"id":"time-series/overfit","title":"Taming Overfitting","description":"Embarking on the intricate journey of time series data analysis reveals a landscape teeming with insights and complexities. Within these sequences of data lies a treasure trove of trends, fluctuations, and patterns waiting to be unveiled. However, as we delve deeper into the art of deciphering time-bound information, we encounter the hurdle of overfitting&mdash;a phenomenon where models become excessively tailored to the training data, jeopardizing their predictive power on unseen instances. In this exploration, we\u2019ll harness Python\u2019s capabilities to tackle overfitting head-on, delving into techniques such as feature selection, cross-validation, and regularization. By embracing tools and guidance, we\u2019ll master the art of mitigating overfitting\u2019s impact in time series analysis, revealing the true essence of the underlying data patterns.","permalink":"/portfolio/docs/time-series/overfit"},{"id":"data-visualization/venn","title":"Venn Diagram","description":"In the world of data visualization, few tools have gained as much recognition as Venn diagrams. These overlapping circles have become synonymous with illustrating set relationships, making complex data more accessible at a glance. Yet, while Venn diagrams are undeniably valuable, they also have a propensity to mislead. As a data scientist, I\u2019ve encountered their allure and their limitations. In this article, we\u2019ll delve into why Venn diagrams, despite their apparent simplicity, can be misleading if not used with caution. We\u2019ll explore the intricacies that lie beneath those overlapping circles, shedding light on when and how to employ them effectively, and when to turn to alternative visualization methods for a more accurate representation of data.","permalink":"/portfolio/docs/data-visualization/venn"}]}')}}]);